import React, { useState } from 'react'

function App() {
  const [likes, func] = useState(5)

  let inc = () => func(likes + 1)
  let dec = () => func(likes - 1)

  return (
    <div className="App">
      <h1>{likes}</h1>
      <button onClick={inc} type="" >+</button>
      <button onClick={dec} type="">-</button>
    </div>
  );
}

export default App;
